function Header() {
    const navigate = useNavigate(); // Хук для перехода
  
    const handleGoBack = () => {
      navigate(-1); // Переход на предыдущую страницу
    };
  
    return (
      <header>
        <h1>My App</h1>
        <button onClick={handleGoBack}>Go Back</button>
      </header>
    );
  }
  
  export default Header;
